import { useSelector } from "react-redux";
import { selectCars, selectFavorites } from "../../redux/selectors";

const CarsList = () => {
  const cars = useSelector(selectCars);
  const favoriteCars = useSelector(selectFavorites);
  return (
    <div>
      {
        (cars.length = 0 ? (
          <p>No cars</p>
        ) : (
          <ul>
            {cars.map((car) => {
              return (
                <li key={car.id}>
                  <span>
                    {car.make} : {car.model}
                  </span>
                </li>
              );
            })}
          </ul>
        ))
      }
    </div>
  );
};
export default CarsList;
